import React from 'react';
import './App.css'


function App() {
  return (
    <div>
      < input className='range ' height={20} width={20} my={4} display="flex" alignItems="center" gap={4}>progress
        <div className='slider'
          aria-label="Temperature"
          defaultValue={30}
          valueLabelDisplay="auto"
          step={10}
          marks
          min={10}
          max={110}
        />
        <div className='fillerStyle' defaultValue={30} step={10} marks min={10} max={110} disabled />
      </input>
    </div>
  );
}
export default App;
